CREATE DEFINER=`root`@`localhost` PROCEDURE `bpjs`(IN `empcode` VARCHAR(50))
if (empcode <> "") then
				  Select a.EmployeeCode, a.FullName, SUM(a.BasicRate * b.IuranPensiun / 100 ) as BPJS from db_payrolldata a, db_setpayroll b where a.EmployeeCode = empcode;  
				  else
				  Select a.EmployeeCode, a.FullName, SUM(a.BasicRate * b.IuranPensiun / 100 ) as BPJS from db_payrolldata a, db_setpayroll b;  				  				   
end if$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `completedloan`(IN `empcode` INT)
BEGIN
delete from db_loan where Realisasi = curdate();
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `CountSalary`(
	IN `empcode` VARCHAR(50)
)
if (empcode <> "" ) then
select a.basicrate + a.allowance + a.incentives + a.mealrate + a.transport - a.basicrate * b.bpjs / 100 - a.basicrate * b.JamKecelakaanKerja - a.basicrate * b.JaminanKesehatan / 100 - a.basicrate * b.iuranpensiun / 100 - a.basicrate * b.JaminanHariTua / 100 - a.basicrate * b.BiayaJabatan / 100 - a.basicrate * b.lates / 100 - a.basicrate * b.JaminanKematian / 100 as hasil from db_payrolldata a, db_setpayroll b where a.EmployeeCode = empcode;
else
select a.EmployeeCode, a.basicrate + a.allowance + a.incentives + a.mealrate + a.transport - (a.basicrate * b.bpjs / 100) - (a.basicrate * b.JamKecelakaanKerja/100) - (a.basicrate * b.JaminanKesehatan / 100) - (a.basicrate * b.iuranpensiun / 100 )- (a.basicrate * b.JaminanHariTua / 100) - (a.basicrate * b.BiayaJabatan / 100) - (a.basicrate * b.lates / 100) - (a.basicrate * b.JaminanKematian / 100) as Hasil from db_payrolldata a, db_setpayroll b;
end if$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `deleteloan`(IN `empcode` VARCHAR(20))
BEGIN
Delete from db_loan
WHERE EmployeeCode = empcode;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `gross`(IN `empcode` VARCHAR(20))
Begin
     if (empcode <> "") then   
        SELECT EmployeeCode, FullName, SUM(BasicRate + Allowance + Incentives + MealRate + Transport) as gross from db_payrolldata where EmployeeCode = empcode;       
       else
        SELECT EmployeeCode, FullName, SUM(BasicRate + Allowance + Incentives + MealRate + Transport) as gross from db_payrolldata;		          
 end if; 
end$$

