 (select 0 t3 union select 1 union select 2 union select 3 union select 4 union select 5 union select 6 union select 7 union select 8 union select 9) t3,
 (select 0 t4 union select 1 union select 2 union select 3 union select 4 union select 5 union select 6 union select 7 union select 8 union select 9) t4) v
where RangeDate between date1 and date2;
end$$

CREATE DEFINER=`root`@`%` PROCEDURE `viewharian`(
	IN `date1` INT,
	IN `date2` INT
)
BEGIN
select a.EmployeeCode, a.FullName, a.Tanggal, a.Shift, a.JamMulai, a.JamSelesai, b.EmployeeType from db_absensi a, db_pegawai b where a.tanggal between @date1 and @date2 and a.EmployeeCode = b.EmployeeCode and b.EmployeeType = 'Harian';
END$$

